    useEffect(()=>{
        const apikey='f5eef3421c602c6cb7ea224104795888';
        let url =`http://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=${apikey}&targetDt=${tDt}`;

        fetch(url)
        .then((resp)=>resp.json())
        .then((data)=>{
            console.log(data);
            data.map((i,n) => 
            <div className="w2div" key={"w2div" + n}> 
                <span className="sp0">{keys[i.category][0]}</span>
                <span className="sp1">{i.obsrValue}</span>
                <span className="sp2">{keys[i.category][1]}</span>
            </div>
        );
            
        })
        .catch((err)=>console.log(err))
    }, [tDt]);
    return (
        <div>
            <div>
                {tDt && mvlist}
            </div>
            <div>
                상세
            </div>
        </div>
    );
    
    }
    export default BoxofficeList;
